using System;
using System.Collections.Generic;
using System.ComponentModel;
using System.Diagnostics;
using System.IO;
using System.Net.Http;
using System.Net.Http.Headers;
using System.Text;
using Newtonsoft.Json.Linq;
using Plugin.Media;
using Plugin.Media.Abstractions;
using Xamarin.Forms;

namespace BillReader
{
    [DesignTimeVisible(false)]
    public partial class MainPage : ContentPage
    {
        string current_image_id = string.Empty;

        public static string ip_address = string.Empty;

        public static List<Images> StoredImages;

        public MainPage()
        {
            InitializeComponent();
            StoredImages = new List<Images>();
        }

        async void HandlerTakePhotoClicked(object sender, EventArgs args)
        {
            TakePhoto();
            //string base64 = "";
            //ReadBill(base64);
        }

        private async void TakePhoto()
        {
            await CrossMedia.Current.Initialize();

            if (!CrossMedia.Current.IsCameraAvailable || !CrossMedia.Current.IsTakePhotoSupported)
            {
                await DisplayAlert("No Camera", ":( No camera available.", "OK");
                return;
            }

            var file = await CrossMedia.Current.TakePhotoAsync(new StoreCameraMediaOptions
            {
                PhotoSize = PhotoSize.Custom,
                CustomPhotoSize = 30,
                CompressionQuality = 40,
                DefaultCamera = CameraDevice.Rear
            });

            if (file == null)
                return;

            var stream = file.GetStream();
            var bytes = new byte[stream.Length];
            await stream.ReadAsync(bytes, 0, (int)stream.Length);
            string base64 = Convert.ToBase64String(bytes);

            ReadBill(base64);
        }

        private async void ReadBill(string image)
        {
            Device.BeginInvokeOnMainThread(() =>
            {
                ScanProgressLabel.IsVisible = true;
            });
            HttpClient client = new HttpClient();

            ip_address = IPAddress.Text;
            string url = "http://" + IPAddress.Text + ":5000/ocr_bill/";
            client.BaseAddress = new Uri(url);
            client.DefaultRequestHeaders.Accept.Add(new MediaTypeWithQualityHeaderValue("application/json"));
            var request = new Request(new string[] { image });
            var jsonData = Newtonsoft.Json.JsonConvert.SerializeObject(request);
            var content = new StringContent(jsonData, Encoding.UTF8, "application/json");
            var response = await client.PostAsync(url, content);
            var result = response.Content.ReadAsStringAsync().Result;
            Device.BeginInvokeOnMainThread(() =>
            {
                if (result != null)
                {
                    JObject data = JObject.Parse(result);
                    BillImage.Source = Xamarin.Forms.ImageSource.FromStream(
                    () => new MemoryStream(Convert.FromBase64String(image)));
                    string cat = "Food"; //data["response"]["category"][0].ToString().Equals("M") ? "Food" : "Travel";
                    Category.Text = "Category: " + cat;
                    Total.Text = "Total: " + data["response"]["total"][0].ToString();
                    Vendor.Text = "Vendor: " + data["response"]["vendor_name"][0].ToString();

                    StoreImage(data["response"]["image_id"][0].ToString(), image);
                    DuplicateButton.IsVisible = true;
                }
                ScanProgressLabel.IsVisible = false;
            });
        }

        private void StoreImage(string image_id, string image)
        {
            current_image_id = image_id;
            //Application.Current.Properties[image_id] = image;
            Images img = new Images();
            img.image_id = image_id;
            img.image = image;
            StoredImages.Add(img);
        }

        async void HandlerDuplicateCheckClicked(object sender, EventArgs args)
        {
            //await DisplayAlert("Image", Application.Current.Properties[image_id].ToString(), "OK");
            await Navigation.PushModalAsync(new DuplicatePage(current_image_id));
        }
    }

    public class Request
    {
        public String[] image_64_encode;

        public Request(string[] image)
        {
            image_64_encode = image;
        }
    }

    public class Images
    {
        public string image_id { get; set; }
        public string image { get; set; }
    }
}
